import styled from 'styled-components'

export const HomeContainer = styled.div`
  margin: 0px;
  display: flex;
  flex-direction: column;
`
export const SideBarAndContentContainer = styled.div`
  display: flex;
`
export const HomeContentContainer = styled.div`
  display: flex;
  flex-direction: column;
  flex-grow: 1;
`
